import React from 'react';
import './App.css';
import {
  ChakraProvider,
  theme,
} from '@chakra-ui/react';
import Homepage from './components/Homepage';
import { Route, Routes } from "react-router-dom";




function App() {
  return (
    <ChakraProvider theme={theme}>
     <Homepage />
    </ChakraProvider>
  );
}

export default App;
